const execute = async(item) => {
    var data = JSON.stringify({
        "unique_id": "MIT@HTTP://MITIMCO_STAGING/",
        "domain": "activity",
        "title": item.title,
        "categories": item.categories
      });
      
      var config = {
        method: 'post',
        url: 'http://127.0.0.1:3030/add_training_data',
        headers: { 
          'Authorization': 'Bearer 54F39463-64EE-40AB-8B4F-6A9B0C0F1360', 
          'Content-Type': 'application/json'
        },
        data : data
      };
      
      let response = await axios(config);

      return response.data;
}

